import './App.css';
import mainlogo from './Logo.png';
import Input from './Input';
import List from './List';
import React from 'react';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {submitted: false, results: null, updates: 0};
    this.changeSubmitState = this.changeSubmitState.bind(this)
    this.handleResults = this.handleResults.bind(this)
  }


  changeSubmitState() {
    this.setState({submitted: true});
    var counter = this.state.updates;
    counter += 1;
    this.setState({updates: counter})
    console.log("hello")
  }

  handleResults(data){
    this.setState({results: data});
    console.log(this.state.results)
  }

  render(){
    return (
      <div id="everything">
        <header id="heading"><img src={mainlogo} id="logo"/>HIGHFLYING</header>
        <Input submitState={this.changeSubmitState} returnResults={this.handleResults}/>
        {this.state.submitted ? <List value={this.state.results}/> : <p id="filler"></p>}

      </div>
    );
  }



}


export default App;
